        },
        {
            id: 'e4',
            title: 'New Desk (Wooden)',
            amount: 450,
            date: new Date(2021, 5, 12),
        },
    ];

    return React.createElement('div',{},
    React.createElement('h2',{},"LETS GET STARTED"),
    React.createElement(Expenses,{expenses:expenses})

    );

